import React from 'react';
import './YouTubeVideo.css';


class YouTubeVideo extends React.Component {
  render() {
    return (
      <iframe width="30" height="315" src="https://www.youtube-nocookie.com/embed/DE58ABNvXzE" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    );
  }
}

export default YouTubeVideo;
